INSERT INTO `hrm_mail` VALUES (1,'hr@netstratum.com','jineed@netstratum.com','registration_mail','Registration Mail','<p>Dear #_FIRSTNAME_# #_LASTNAME_#,<br />\n<br />\nYour HRM account is now active. Please find your login information below.<br />\nUsername : &nbsp;#_USERNAME_#<br />\nPassword : &nbsp;#_PASSWORD_#<br />\n<br />\nPlease feel free to change your password after your first login.<br />\n<br />\nThanks,<br />\nNetstratum HR.</p>\n','#_FIRSTNAME_#~Employee First Name|#_LASTNAME_#~Employee Last Name|#_USERNAME_#~Employee User Name|#_PASSWORD_#~Employee Password','Your Netstratum HRM account is now active.'),(2,'hr@netstratum.com','','forgot_password','Forgot Password','<p>Dear #_FIRSTNAME_#,</p>\n\n<p>This is in response with your recent request on Netstratum HRM</p>\n\n<p>Your new password is : #_PASSWORD_#</p>\n\n<p>Thanks,</p>\n\n<p>HR Admin,</p>\n\n<p>Netstratum.</p>\n','#_FIRSTNAME_#~Employee First Name|#_USERNAME_#~Employee User Name|#_PASSWORD_#~Employee Password','Your Account Recovery Information'),(4,'hr@netstratum.com','','leave_request_admin_confirm','Apply Leave to admin,hr,supervisors','<p>Hi,</p>\n\n<p>#_FIRSTNAME_# requested for #_LEAVE_TYPE_#&nbsp;&nbsp;on&nbsp;#_LEAVE_DATE_# for&nbsp;#_DAYS_# day(s).</p>\n\n<p>Leave Reason- #_REASON_#</p>\n\n<p>&nbsp;Please login to HRM to approve / reject this request.</p>\n\n<p>Thanks,</p>\n\n<p>Netstratum HR</p>\n','#_FIRSTNAME_#~Employee First Name|#_LASTNAME_#~Employee Last Name|#_LEAVE_DATE_#~Leave Date|#_DAYS_#~Days|#_LEAVE_TYPE_#~Leave Type|#_EMPLOYEE_EMAIL_#~Employee Email|#_REASON_#~Reason | Employee Leave Request','Employee Leave Request'),(5,'hr@netstratum.com','jineed@netstratum.com','leave_assign','Assign Leave to Employee','<p>Dear #_FIRSTNAME_#,&nbsp;</p>\n\n<p>New #_LEAVE_TYPE_# category has been added to you.</p>\n\n<p>Thanks,</p>\n\n<p>Netstratum HR</p>\n','#_FIRSTNAME_#~Employee First Name|#_EXPIRE_DATE_#~Leave Expiration Date|#_DAYS_#~Days|#_LEAVE_TYPE_#~Leave Category|#_EMPLOYEE_EMAIL_#~Employee Email','New Leave Category Added'),(8,'hr@netstratum.com','','leave_cancel_admin','Cancel Leave Confirmation to Admin,Hr,Supervisors','<p>Dear Team,</p>\n\n<p>This is to inform you that&nbsp;#_FIRSTNAME_#&nbsp;cancelled his leave request.</p>\n\n<p>Thanks,<br />\nNetstratum HR</p>\n','#_FIRSTNAME_#~Employee First Name|#_LEAVE_DATE_#~Leave Date|#_DAYS_#~Days|#_LEAVE_TYPE_#~Leave Type|#_EMPLOYEE_EMAIL_#~Employee Email|#_REASON_#~Reason','Employee Leave Cancelled.'),(9,'hr@netstratum.com','','leave_reject','Leave Reject to Employee','<p>Dear #_FIRSTNAME_#,</p>\n\n<p>This is to inform you that your request for&nbsp;#_LEAVE_TYPE_# has been rejected.</p>\n\n<p>Thanks,</p>\n\n<p>Netstratum HR</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n','#_FIRSTNAME_#~Employee First Name|#_LEAVE_DATE_#~Leave Date|#_DAYS_#~Days|#_LEAVE_TYPE_#~Leave Type|#_EMPLOYEE_EMAIL_#~Employee Email|#_REMARKS_#~Remarks','Leave Status'),(11,'admin@netstratum.com','','leave_reject_super','Leave Reject Status to HR/Admin','<p>#_FIRSTNAME_#&#39;s Leave Rejected</p>\n','#_FIRSTNAME_#~Employee First Name|#_LEAVE_DATE_#~Leave Date|#_DAYS_#~Days|#_LEAVE_TYPE_#~Leave Type|#_EMPLOYEE_EMAIL_#~Employee Email|#_REMARKS_#~Remarks','Employee Leave Rejected'),(13,'hr@netstratum.com','','leave_approve','Leave Approval Mail for Employee','<p>Dear&nbsp;#_FIRSTNAME_#,</p>\n\n<p>Your request for #_LEAVE_TYPE_# leave&nbsp; on&nbsp;#_LEAVE_DATE_# has been approved.</p>\n\n<p>Thanks,</p>\n\n<p>Netstratum HR.</p>\n\n<p>&nbsp;</p>\n','#_FIRSTNAME_#~Employee First Name|#_LEAVE_DATE_#~Leave Date|#_DAYS_#~Days|#_LEAVE_TYPE_#~Leave Type|#_EMPLOYEE_EMAIL_#~Employee Email|#_REMARKS_#~Remarks','Leave Approved'),(14,'admin@netstratum.com','','resource_assign','Resource Assigned','<p>The Resource item #_RESOURCE_NAME_# assigned to #_NAME_#</p>','#_NAME_#~Employee Name|#_RESOURCE_NAME_#~Resource Name','Resource Assigned'),(15,'','','resource assign_employee','','','',''),(16,'admin@netstratum.com','','resource_assign_return','Resource Returned','<p>The Resource item #_RESOURCE_NAME_# returned from #_NAME_#</p>','#_NAME_#~Employee Name|#_RESOURCE_NAME_#~Resource Name','Resource Returned'),(17,'admin@netstratum.com','','resource_added','New Resource Added','<p>The Resource item #_RESOURCE_NAME_# added.</p>','#_RESOURCE_NAME_#~Resource Name','New Resource Added'),(18,'admin@netstratum.com','','resource_removed',' Resource Removed','<p>The Resource item #_RESOURCE_NAME_# removed from system.</p>','#_RESOURCE_NAME_#~Resource Name','Resource Removed');
